import React from 'react'

function Home() {
  return(
    <div className='home'>
         <div className='headerContainer'>
           <h1>Peri Peri 5 Leg Pc & 2 Dips</h1>
           <p>Save Rs. 120 on 5 Peri Peri Leg Pieces, paired with 2 delicious dips (20gm each)</p>
         </div>
    </div>
  )
}

export default Home
